    "2015-09-03T05:38:17.365653",nt"name": "sfec-3-216d-gifts-of-travel-filings",nt"isopen":
    true,nt"url": null,nt"notes": "Under section 3.216(d) of the San Francisco
    Campaign and Governmental Conduct Code, form SFEC-3.216(d) must be filed by an elected
    officer who either:(a) accepts a gift of transportation, lodging, or subsistence
    for any out-of-state travel that is paid for in part by an entity other than the
    City and County of San Francisco, another governmental body, or a bona-fide educational
    institution as defined in section 203 of the Revenue and Taxation Code, or that
    is paid for by the City in whole or in part with funds donated from any entity other
    than another governmental body or bona fide educational institution as defined in
    Section 203 of the Revenue and Taxation Code; or(b) reimburses the entity for the
    gift of transportation, lodging or subsistence in order to avoid receiving a gift.This
    table includes filings from April 2015 to the present.",nt"license_title":
